import "./App.css";
import { Routes, Route, Router } from "react-router-dom";
import Dashboard from "./Dashboard";

const App = () => {
  return (
    <Router>
      <Routes>
      <Route exact path="/dashboard" component={Dashboard} />
      </Routes>
    </Router>
  );
};
export default App;
